# несколько строк, BEGIN/END не обязательны). Комда для генерации:
#   openssl req -new -x509 -days 3652 -nodes -out saml.crt -keyout saml.key
SOCIAL_AUTH_SAML_SP_PUBLIC_CERT = """
-----BEGIN CERTIFICATE-----
bla
bla
bla
-----END CERTIFICATE-----
"""

# Приватный ключ локального сертификата сервера (может быть записан в несколько
# строк, BEGIN/END не обязательны)
SOCIAL_AUTH_SAML_SP_PRIVATE_KEY = """
-----BEGIN PRIVATE KEY-----
bla
bla
bla
-----END PRIVATE KEY-----
"""

